    /// | ---|---|--- |
    /// | SourceId|id|  |
    /// | CorporateActionId|code|  |
    /// | AnnouncementDate|datetime|  |
    /// | ExDate|datetime|  |
    /// | RecordDate|datetime|  |
    /// | PaymentDate|datetime|  |
    ///
    ///
    ///
